import React, { Fragment } from 'react';
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const kuchB = ({ isAuthenticated }) => {
  if (isAuthenticated) {
    return <Redirect to='/dashboard' />;
  }

  return (
    <Fragment>
      <nav class='menu' tabindex='0'>
        <div class='smartphone-menu-trigger'></div>
        <header class='avatar'>
          <img src='https://s3.amazonaws.com/uifaces/faces/twitter/kolage/128.jpg' />
          <h2>John D.</h2>
        </header>
        <ul>
          <li tabindex='0' class='icon-dashboard'>
            <span>Dashboard</span>
          </li>
          <li tabindex='0' class='icon-customers'>
            <span>Customers</span>
          </li>
          <li tabindex='0' class='icon-users'>
            <span>Users</span>
          </li>
          <li tabindex='0' class='icon-settings'>
            <span>Settings</span>
          </li>
        </ul>
      </nav>

      <main>
        <div class='helper'>
          RESIZE THE WINDOW
          <span>Breakpoints on 900px and 400px</span>
        </div>
      </main>
    </Fragment>
  );
};

kuchB.propType = {
  isAuthenticated: PropTypes.bool
};

const mapStateToProp = state => ({
  isAuthenticated: state.auth.isAuthenticated
});
export default connect(mapStateToProp)(kuchB);
